Let me work step by step as requested:

**Step 1: Key Psychological Mechanisms**
- **Fairness Sensitivity:** Proposers care about what is fair. In this task, “fair” is ambiguous because contributions (“token_self”, “token_opp”) can differ: fairness may refer to proportional contributions or simply to equality.
- **Strategic Considerations (“Greed”/Self-interest):** The proposer may want to maximize their own outcome, offering less than fair if they can get away with it.
- **Perceived Minimum Acceptable Offer:** The proposer might anchor their offer on what they believe a responder would accept. In real settings, this is typically ≥30% of the pot, but here, proposers may adjust based on contributions.
- **Noise/Stochasticity in Choices:** Not every choice is deterministic.

**Step 2: How Mechanisms Interact**
- The proposer’s offer will be a weighted combination of:
    - The equitable share (proposer’s contribution / total contributions)
    - A baseline “fair” split (typically 50%, but adjusted for contributions)
    - Self-interest, perhaps reducing the offer compared to fairness
- Choices are variable: people rarely give exactly the same share each time, even in similar situations.

**Step 3: Mathematical Formulation**
- The model should predict the proportion of the pot proposed to the partner: `proposed_perc` (i.e., the % share of the opponent).
- The fairness reference can be constructed as: \( S_{\text{fair}} = \frac{\text{token\_opp}}{\text{token\_opp} + \text{token\_self}} \cdot 100 \)
    - This represents a “proportional” split based on contribution.
    - The data’s “combined_earning” variable is: \((\text{token\_self} + \text{token\_opp}) \times 3\) (since each token is £3).
- The proposer may deviate from this reference by a fixed “selfishness” parameter.
- So, predicted proposal: 
    \( \text{proposed\_perc}_{\text{pred}} = \alpha \cdot S_{\text{fair}} + \beta \)
      - where α moderates sensitivity to proportional fairness. If α=1, full fairness; α=0, no fairness consideration.
      - β is a constant shift (bias/selfishness) that can be negative (take more for self) or positive.
- To allow for stochasticity (parameter recovery, likelihood), error ~ N(0, σ)
- For utility: The probability (under a softmax) of selecting an offer decreases < 50% when the predicted utility falls below zero.

**Step 4: Learnable Parameters**
- α (“fairness weight”): [0, 2] – modulates fairness sensitivity.
- β (“selfishness bias”): [-50, 50] – baseline bias, can take/leave up to 50 ppt from proportional fairness.
- σ (“choice noise”): [0, 30] – SD of proposal noise; allows some fitting of preference expression randomness.
   - Reasoning: Avoid excessive parameterization for identifiability. Three is parsimonious, orthogonalized.

**Step 5: Observables Mapping**
- Input: token_self, token_opp (each trial, when trial_role==2)
- Output: proposed_perc
- Model: predicts the mean proposal % made by the participant each proposer trial.

